import React from "react";
import { Link } from "react-router-dom"

const Nav = () => {
    return (
        <nav>
            <ul>
                <li>
                    <Link to="/" exact activeStyle={{fontWeight: 'bold', color: '#dddddd'}}>Home</Link>
                </li>
                <li>
                    <Link to="/about" exact activeStyle={{fontWeight: 'bold', color: 'red'}}>About</Link>
                </li>
            </ul>
        </nav>
    );
}

export default Nav;
